int main(void)
{
	//Assign values to global variables
	//Can put this in a function
	resolutionX= 320;
	resolutionY = 240;
	n = 8;
	midScreenX = resolutionX / 2;
	midScreenY = resolutionY / 2;
	gridMinX = midScreenX - midScreenY;
	gridMaxX = midScreenX + midScreenY;
	gridSideLength = gridMaxX - gridMinX;
	boxSideLength = (gridSideLength - (5 * GRID_LINE_WIDTH)) / 4;
	
	/* interrupt setup start */
	set_A9_IRQ_stack(); // initialize the stack pointer for IRQ mode
	config_GIC(); // configure the general interrupt controller
	config_keyboard(); // configure keyboard interrupt
	
	enable_A9_interrupts(); // enable interrupts in the A9 processor

	/* interrupt setup end */
	
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr; // initialize a pointer to the pixel buffer, used by drawing functions
	draw_background();
	clear_grid();
    *(pixel_ctrl_ptr + 1) = 0xC0000000; // set back pixel buffer to start of SDRAM memory
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	
	draw_background();
	while (!gameStart) {
		draw_home_screen();
		wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	}
	
	draw_background();
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	draw_background();
	// spawn 2 tiles
	spawn_without_animate();
	spawn_without_animate();

	//spawn_tile();
	//spawn_tile();

    while (gameContinue)
    {
        /* Erase any boxes and lines that were drawn in the last iteration */
		draw_grid();
		draw_all_tiles();
		displayScore();
		
		if(checkGridFull()){
			if(!checkValidMoves()){
				gameLost = true;
			}
		}
		
		wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		
		//Victory screen
		if(gameWon){
			gameStart = false;
			while(!gameStart) {
				draw_win_screen();
				wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			}
			
			// reset values and clear grid
			gameWon = false;
			clear_grid();
			
			// spawn 2 tiles
			spawn_without_animate();
			spawn_without_animate();
		}

		//Game over screen
		if(gameLost){
			gameStart = false;
			while(!gameStart) {
				draw_lose_screen();
				wait_for_vsync();
				pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
			}
			
			// reset values and clear grid
			gameLost = false;
			clear_grid();
			
			// spawn 2 tiles
			spawn_without_animate();
			spawn_without_animate();
		}
		
    }
}

//Checks if there are any valid moves to be made
bool checkValidMoves(){
	int gridSave[4][4];
	//save the grid
	for(int row = 0; row < 4; row++){
		for(int col = 0; col < 4; col++){
			gridSave[row][col] = grid[row][col];
		}
	}
	
	//no valid moves
	if(!move_tiles('U') && !move_tiles('D') && !move_tiles('L') && !move_tiles('R')){	//no valid moves
		return false;
	}
	
	//restore the grid
	for(int row = 0; row < 4; row++){
		for(int col = 0; col < 4; col++){
			grid[row][col] = gridSave[row][col];
		}
	}
	return true;	
}


//Checks if the grid is full
bool checkGridFull(){
	for(int row = 0; row < 4; row++){
		for(int col = 0; col < 4; col++){
			if(grid[row][col] == 0){
				return false;
			}
		}
	}
	
	return true;
}




void draw_home_screen() {
	for(int x = 0; x < resolutionX; x++) {
		for(int y = 0; y < resolutionY; y++) {
			plot_pixel(x, y, home_screen[y][x]);
		}
	}
}

void draw_win_screen() {
	for(int x = 0; x < resolutionX; x++) {
		for(int y = 0; y < resolutionY; y++) {
			plot_pixel(x, y, win_screen[y][x]);
		}
	}
}

void draw_lose_screen() {
	for(int x = 0; x < resolutionX; x++) {
		for(int y = 0; y < resolutionY; y++) {
			plot_pixel(x, y, lose_screen[y][x]);
		}
	}
}

void displayScore(){
	int displayNumHEX3_0 = 0;
	int displayNumHEX5_4 = 0;
	int digits = 0;
	int currentPoints = totalPoints;
	
	while(currentPoints > 0){
		int digit = currentPoints % 10;
		currentPoints /= 10;
		
		//shift and combine
		if(digits < 4){
			displayNumHEX3_0 = (hexdisplay[digit] << 8*digits) | displayNumHEX3_0;
		}
		else{
			displayNumHEX5_4 = (hexdisplay[digit] << 8*(digits - 4)) | displayNumHEX5_4;
		}
		digits++;
		
	}

	*(HEX3_HEX0_BASE) = displayNumHEX3_0;
	*(HEX5_HEX4_BASE) = displayNumHEX5_4;
}

void addToPoints(int points) {
	totalPoints += points;
}

bool combine_tiles(int position, char input){
	bool changed = false;
	if(input == 'U'){
		//Loop through rows
		for(int row = 0; row < 3; row++){
			//If we hit a 0 then stop
			if(grid[row][position] == 0){
				break;
			}
			//Two adjacent tiles have same value
			if(grid[row][position] == grid[row+1][position]){
				grid[row][position] *= 2;
				
				//Game won
				if(grid[row][position] == 2048){
					gameContinue = false;
					gameWon = true;
				}
					
				//Add new doubled number to points
				addToPoints(grid[row][position]);
				
				grid[row+1][position] = 0;
				changed = true;
				//Shift remaining blocks
				for(int shiftRow = row + 1; shiftRow < 3; shiftRow++){
					grid[shiftRow][position] = grid[shiftRow+1][position];
					grid[shiftRow+1][position] = 0;
				}
			}
		}
	}
	else if(input == 'D'){
		//Loop through rows
		for(int row = 3; row > 0; row--){
			//If we hit a 0 then stop
			if(grid[row][position] == 0){
				break;
			}
			//Two adjacent tiles have same value
			if(grid[row][position] == grid[row-1][position]){
				grid[row][position] *= 2;
				
				//Game won
				if(grid[row][position] == 2048){
					gameContinue = false;
					gameWon = true;
				}
				
				//Add new doubled number to points
				addToPoints(grid[row][position]);
				
				grid[row-1][position] = 0;
				changed = true;
				//Shift remaining blocks
				for(int shiftRow = row - 1; shiftRow > 0; shiftRow--){
					grid[shiftRow][position] = grid[shiftRow-1][position];
					grid[shiftRow-1][position] = 0;
				}
			}
		}
	}
	else if(input == 'L'){
		//Loop through cols
		for(int col = 0; col < 3; col++){
			//If we hit a 0 then stop
			if(grid[position][col] == 0){
				break;
			}
			//Two adjacent tiles have same value
			if(grid[position][col] == grid[position][col+1]){
				grid[position][col] *= 2;
				
				//Game won
				if(grid[position][col] == 2048){
					gameContinue = false;
					gameWon = true;
				}
				
				//Add new doubled number to points
				addToPoints(grid[position][col]);
				
				grid[position][col+1] = 0;
				changed = true;
				//Shift remaining blocks
				for(int shiftCol = col + 1; shiftCol < 3; shiftCol++){
					grid[position][shiftCol] = grid[position][shiftCol+1];
					grid[position][shiftCol+1] = 0;
				}
			}
		}
	}
	else if(input == 'R'){
		//Loop through cols
		for(int col = 3; col > 0; col--){
			//If we hit a 0 then stop
			if(grid[position][col] == 0){
				break;
			}
			//Two adjacent tiles have same value
			if(grid[position][col] == grid[position][col-1]){
				grid[position][col] *= 2;
				
				//Game won
				if(grid[position][col] == 2048){
					gameContinue = false;
					gameWon = true;
				}
				
				//Add new doubled number to points
				addToPoints(grid[position][col]);
				
				grid[position][col-1] = 0;
				changed = true;
				//Shift remaining blocks
				for(int shiftCol = col - 1; shiftCol > 0; shiftCol--){
					grid[position][shiftCol] = grid[position][shiftCol-1];
					grid[position][shiftCol-1] = 0;
				}
			}
		}
	}
	return changed;
}

//shifts all tiles on the grid depending on which direction
bool move_tiles(char input){
	bool moved = false;
	if(input == 'U'){
		for(int col = 0; col < 4; col++){
			int pos = 0;
			for(int row = 0; row < 4; row++){
				if(grid[row][col] != 0){
					if(row == pos){
						pos++;
						continue;
					}
					animate_move(row, pos, col, col, grid[row][col]);
					grid[pos][col] = grid[row][col];
					prev_grid[row][col] = grid[row][col];
					grid[row][col] = 0;
					moved = true;
					pos++;
				}
			}
			if(combine_tiles(col, input)){moved = true;};				
		}	
	}
	else if(input == 'D'){
		for(int col = 0; col < 4; col++){
			int pos = 3;
			for(int row = 3; row >= 0; row--){
				if(grid[row][col] != 0){
					if(row == pos){
						pos--;
						continue;
					}
					grid[pos][col] = grid[row][col];
					prev_grid[row][col] = grid[row][col];
					grid[row][col] = 0;
					moved = true;
					pos--;
				}
			}
			if(combine_tiles(col, input)){moved = true;};
		}	
	}
	else if(input == 'L'){
		for(int row = 0; row < 4; row++){
			int pos = 0;
			for(int col = 0; col < 4; col++){
				if(grid[row][col] != 0){
					if(col == pos){
						pos++;
						continue;
					}
					grid[row][pos] = grid[row][col];
					prev_grid[row][col] = grid[row][col];
					grid[row][col] = 0;
					moved = true;
					pos++;
				}
			}
			if(combine_tiles(row, input)){moved = true;};
		}	
	}
	else if(input == 'R'){
		for(int row = 0; row < 4; row++){
			int pos = 3;
			for(int col = 3; col >= 0; col--){
				if(grid[row][col] != 0){
					if(col == pos){
						pos--;
						continue;
					}
					grid[row][pos] = grid[row][col];
					prev_grid[row][col] = grid[row][col];
					grid[row][col] = 0;
					moved = true;
					pos--;
				}
			}
			if(combine_tiles(row, input)){moved = true;};
		}	
	}
	erase_all_tiles();
	return moved;
	
}

// animate movement of blocks
void animate_move(int rStart, int rEnd, int cStart, int cEnd, int num) {
	int dRow = rEnd - rStart;
	int dCol = cEnd - cStart;
	
	if (dRow < 0) {
		dRow = -1;
	} else {
		dRow = 1;
	}
	
	if (dCol < 0) {
		dCol = -1;
	} else {
		dCol = 1;
	}
	
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	
	if (dRow == 0) { // moving left and right
		for(int col = cStart; col <= cEnd; col += dCol) {
			draw_tile(rStart, col, num, boxSideLength);
			wait_for_vsync();
        	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
		}
	} else if (dCol == 0) { // moving up and down
		
	}
}

